import { Card } from "antd";
import Avatar from "antd/lib/avatar/avatar";
import React from "react";

const UserProfile = () => {
  return (
    <Card actions={[]}>
      <Card.Meta avatar={<Avatar>ZC</Avatar>} title="Zerochoe"/>
    </Card>
  );
};

export default UserProfile;
